import React, { Component } from 'react';
import { Container, Jumbotron,Row,Col,Card } from 'reactstrap';
import { Media,CardBody,CardImg,CardTitle,CardText,CardSubtitle,Button } from 'reactstrap';

class Profile extends Component {
    constructor(props){
        super(props);
    }

    
  render()
   {
    return (
      <Jumbotron >
        <Media>
         <Container fluid>
          <div class="media">
          <Row>
           <img class="align-self-center ml-3" data-src="holder.js/500Ã—500" alt="Avatar"class="rounded-circle"></img>
          
          </Row>
          </div>
          <Container>
          <Row>

           <div class="w-100 p-3">
            
             <h2 class="ml=5">Username</h2>
           </div>
          </Row>
          </Container>
          
          
         </Container>
        <Container>
         <div>
          <Card>
           <CardImg top width="100%" src="/assets/318x180.svg" alt="Poster" />
           <CardBody>
            <CardTitle tag="h5">Movie Name</CardTitle>
            <CardSubtitle tag="h6" className="mb-2 text-muted">Details</CardSubtitle>
            <CardText>Review for that movie</CardText>
            <Button>Read</Button>
            </CardBody>
          </Card>
         </div>
          </Container>
         
        </Media>
      </Jumbotron>
    );
   };
}

export default Profile
